import React, { Component } from "react";

export default class Input extends Component {
    render() {
        return (
            <>
                <input
                    type="text"
                    id="name"
                    name="name"
                    id="input-text"
                    placeholder="Search"
                    onChange={() => this.props.handleChange}
                />

                <button onClick={() => this.props.handleOnclick}>
                    <i className="fa fa-search" />
                </button>
            </>
        );
    }
}
